import Header from './header';
import Head from 'next/head';
import { Container } from "react-bootstrap";
import "../styles/sass/basic.scss";

const Layout =  (props:any) => {
    return(
        <div>
            <Head >
                <title>Meli</title>
            </Head>
            <Header></Header>
            <Container >
                <div className="p-4">
                    {props.children}
                </div> 
               
            </Container>
           
        </div>
    )

}
export default Layout;
